import React from "react";
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  TouchableOpacity,
} from "react-native";

const WelcomeScreen = () => {
  return (
    <ImageBackground
      style={styles.background}
      source={{
        uri: "https://source.unsplash.com/featured/?abstract,background",
      }}
    >
      <TouchableOpacity> Go to Home Screen </TouchableOpacity>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
  },
});
export default WelcomeScreen;
